import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import First from './first_page/first'
import FragmentAndCss from './fragment_&_css/fragment_and_css'
import { Props, Counter, Button } from './04_props/props'
import Form from './10_form/Form'
import Hoc from './14_hoc/hoc'
import Api from './16_rest_api/rest_api'
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  <React.StrictMode>
      <div className={'container-fluid'}>
          <Props child={ <Button/> } ><Counter/></Props>
          <First/>
          <FragmentAndCss/>
          <Form/>
          <br/>
          <br/>
          <Hoc/>
          <Api/>
      </div>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
